        let videos = rawText.trim().split("\n").map(line => {
            let parts = line.trim().split(": ");
            return { number: parts[0], url: parts[1] };
        });


        // âœ… Unique localStorage key for this page
        const STORAGE_KEY = "favs";

        let loadedVideos = 0;
        let batchSize = 10;
        let maxVideosInDOM = 20;
        let watchedVideos = JSON.parse(localStorage.getItem(STORAGE_KEY)) || [];

        document.getElementById("totalCount").innerText = videos.length;
        updateCounters();

    function getShareLink(embedUrl) {
        let videoId = embedUrl.match(/(\d+)\/?$/)[1]; // Extract the numeric video ID
        return `https://www.tiktok.com/share/video/${videoId}/`;
    }

    function loadVideos() {
        let container = document.getElementById("videoContainer");
        let count = 0;

        while (loadedVideos < videos.length && count < batchSize) {
            let video = videos[loadedVideos];

            if (!watchedVideos.includes(video.url)) {
                let shareLink = getShareLink(video.url); // Convert embed to share format

                let videoDiv = document.createElement("div");
                videoDiv.classList.add("video-item");
                videoDiv.setAttribute("data-index", loadedVideos);
                videoDiv.innerHTML = `
                    <iframe src="${video.url}" frameborder="0" scrolling="no"></iframe>
                    <div class="buttons-container">
                        <span class="video-number">${video.number}</span>
                        <button class="link-btn" onclick="window.open('${shareLink}', '_blank')">Open Link</button>
                        <button class="watch-btn" onclick="markWatched('${video.url}', this)">Watched âœ“</button>
                    </div>
                `;
                container.appendChild(videoDiv);
                count++;
            }
            loadedVideos++;
        }
        updateCounters();
    }


        function markWatched(url, btn) {
            watchedVideos.push(url);
            localStorage.setItem(STORAGE_KEY, JSON.stringify(watchedVideos));
            btn.parentElement.parentElement.remove();
            updateCounters();
        }

        function updateCounters() {
        document.getElementById("totalCount").textContent = videos.length;
        document.getElementById("watchedCount").textContent = watchedVideos.length;
    }

        function toggleWatched() {
            let videoContainer = document.getElementById("videoContainer");
            let watchedContainer = document.getElementById("watchedContainer");
            let btn = document.querySelector(".show-watched-btn");

            if (watchedContainer.style.display === "none") {
                watchedContainer.style.display = "flex";
                videoContainer.style.display = "none";
                btn.innerText = "Show Unwatched";
                showWatchedVideos();
            } else {
                watchedContainer.style.display = "none";
                videoContainer.style.display = "flex";
                btn.innerText = "Show Watched";
            }
        }

        function showWatchedVideos() {
            let watchedContainer = document.getElementById("watchedContainer");
            watchedContainer.innerHTML = ""; // Clear old content

            watchedVideos.forEach((url, index) => {
                let videoDiv = document.createElement("div");
                videoDiv.classList.add("video-item");
                videoDiv.innerHTML = `
                    <iframe src="${url}" frameborder="0"></iframe>
                    <div class="buttons-container">
                        <span class="video-number">${index + 1}</span>
                        <button class="link-btn" onclick="window.open('${url}', '_blank')">Open Link</button>
                        <button class="watch-btn" onclick="unmarkWatched('${url}', this)">Unwatch âŒ</button>
                    </div>
                `;
                watchedContainer.appendChild(videoDiv);
            });
        }

        function unmarkWatched(url, btn) {
            watchedVideos = watchedVideos.filter(v => v !== url);
            localStorage.setItem(STORAGE_KEY, JSON.stringify(watchedVideos));
            btn.parentElement.parentElement.remove();
            updateCounters();
        }

        window.addEventListener("scroll", () => {
            if (window.innerHeight + window.scrollY >= document.body.offsetHeight - 50) {
                loadVideos();
            }
        });

        loadVideos();


function toggleMenu() {
    let menu = document.getElementById("menu");
    menu.style.display = menu.style.display === "block" ? "none" : "block";
}
